import React from "react";
import If, { Else } from "./If";

export default (props) => {
  const user = props.userName || {};
  return (
    <div>
      <If test={user && user.name}>
        Seja bem vindo <strong> {user.name}</strong>
        <Else>Seja bem vindo, insira seu nome!</Else>
      </If>
    </div>
  );
};
